import React from "react";
import "./Checkout.css";
import Subtotal from "./Subtotal";
import "./Subtotal.css";

function Checkout() {
  return (
    <div className="checkout">
      <div className="checkout_keft">
        <img
          className="checkout_ad"
          src="https://images-eu.ssl-images-amazon.com/images/G/31/img20/Events/jupiter20/affordability/Header_PC_1500x178_last.jpg"
          alt=""
        />

        <div>
          <h1 className="checkout_title">Your Shopping Basket</h1>
        </div>
      </div>

      <div className="check_right">
        <Subtotal />
      </div>
    </div>
  );
}

export default Checkout;
